var vueCommon=new Vue({el:"#vueCommon",data:{},methods:{hidePhoneNumber:function(a){var b=a.split("-");if(b.length===2){return b[0]+"-****"}else{if(b.length===3){return b[0]+"-"+b[1]+"-****"}}return a},checkPhoneNumberType:function(b){var c=b.replace(/[^0-9]/g,"");var a=c.length;var d="";if(a<7){return b}else{if(a===7){d+=c.substr(0,3);d+="-";d+=c.substr(3,4);return d}else{if(a===8){console.log("digit 8 "+c);d+=c.substr(0,4);d+="-";d+=c.substr(4,8);return d}else{if(a===9){d+=c.substr(0,2);d+="-";d+=c.substr(2,3);d+="-";d+=c.substr(5,9);return d}else{if(a===10){if(c.substr(0,2)==="02"){d+=c.substr(0,2);d+="-";d+=c.substr(2,4);d+="-";d+=c.substr(6,4);return d}else{console.log("digit 10 and !02 "+c);d+=c.substr(0,3);d+="-";d+=c.substr(3,3);d+="-";d+=c.substr(6,4);return d}}else{if(a===11){d+=c.substr(0,3);d+="-";d+=c.substr(3,4);d+="-";d+=c.substr(7,4);return d}}}}}}},separateMemo:function(d,a,c){if(d===null||d===""){return"<div class='center'>-</div>"}var e=d.split("{}");var b=a.split("{}");var g=c.split("{}");var h="";for(var l=0,f=e.length;l<f;l++){var d=e[l];var j=b[l];var k=g[l];h+="<div>"+j+" <i class='fa fa-arrow-circle-o-right'></i> "+d;h+="<small>("+k+")</small>";h+="</div>"}return h},extractDateFromDateTime:function(a){if(a){return new moment(a).format("YYYY-MM-DD")}return"날짜없음"}}});